import styled from 'styled-components';

export const Container = styled.header`
  background: var(--blue);
  display: flex;
  align-items: center;
`;

export const Content = styled.div`
  max-width: 1128px;
  height: 37vh;
  margin: 0 auto;
  display: flex;
  align-items: flex-end;
`;
